import React from 'react';
import PropTypes from 'prop-types';

import '../../styles/ColorScheme.css';
import '../../styles/ElectionBallotReceipt.css';

const propTypes = {
    show: PropTypes.boolean
};

const defaultProps = {
    show: false
};

function ElectionBallotReceipt(props) {
    const {
        show
    } = props;

    const modalVisibility = show ? "block" : "none";
    const animation = show ? "animate-in" : "";

    return (
        <div className="election-ballot-receipt-container" style={{ display: modalVisibility }}>
            <div className={`election-ballot-receipt ${animation}`}>
                <div className="election-ballot-title">
                    Ballot Receipt
                </div>
            </div>
        </div>
    );
}

ElectionBallotReceipt.propTypes = propTypes;
ElectionBallotReceipt.defaultProps = defaultProps;
export default ElectionBallotReceipt;
